/**
 *    
 * @param inn
 * @returns boolean
 */
function isValidInn(inn) {
	
	var minYear = 18;	//    
	var maxYear = 85;	//    
	
	var flagValid = true;
	
	if (inn.length > 0) {
		var dateB = new Date(1900, 0, 1);			//  01.01.1900
		var days = parseInt(inn.substring(0, 5));	//    01.01.1900 
		dateB.setDate(dateB.getDate() + days -1);		// 
		
		var dayB = $("#day").val();
		var monthB = $("#month").val();
		var yearB = $("#year").val();
		
		// console.log(': ' + dateB.getFullYear() + ' : ' + (dateB.getMonth() +1) + ' : ' + dateB.getDate());
		// alert(' ' + dateB.getFullYear() + '  ' + (dateB.getMonth() + 1) + '  ' + dateB.getDate() + '   input: ' + dayB + '.' + monthB + '.' + yearB);
		
		//      :
		if (parseInt(dayB) !== dateB.getDate() || parseInt(monthB) !== (dateB.getMonth() +1) || parseInt(yearB) !== dateB.getFullYear()) {
			flagValid = false;
		}
		//  :
		var dateNow = new Date();
		if ((parseInt(yearB) > dateNow.getFullYear() - minYear) || (parseInt(yearB) < dateNow.getFullYear() - maxYear)) {
			flagValid = false;
		}
	}

	return flagValid;
}

