/**
 *   
 * @param idPhone id  input
 * @returns {Boolean}
 */
function onKeyUpPhone(idPhone) {

	var str = $("#" + idPhone).val();
	var strNum = str.replace(/\D+/g,"");	//   
	
	//console.log('str='+str);
	
	if (strNum.length > 4) {
		var flag = false; //   
		
		if (str.substring(0, 4) !== '+380') {
			flag = true;
		} else {
			var prefix = strNum.substring(3, 5);	//  
			flag = true;
			//    :
			arrPrefix.forEach(function(item, i, arr) {
				//console.log('item='+item);
				if (item == prefix) flag = false;
			});
		}
		
		//   :
		if (flag) {
			$("#" + idPhone).val("+380");	//  
			strNum = '380';
			$("#" + idPhone).mask("+38999 999 9999", {
	            autoclear: false
	        });
			$("#" + idPhone).focus();	//  
			$("#" + idPhone).selectionStart = 4;	//   
		}

		//  /  :
		// if ((strNum.length == 12) && (document.getElementById("regCodereg").value.length == 0)) {
		if ((strNum.length == 12) && (($('#regCodereg').val() == '') || ($("#regCodereg").length = 0))) {
			$('#buttonGetCode').removeAttr('disabled');

			if (flagReg.reCaptcha) {
				$('#buttonGetCode').removeAttr('disabled');
			}
			flagReg.phone = true;
		} else {
			$('#buttonGetCode').attr('disabled', true);
			flagReg.phone = false;
		}
		// console.log(flagReg);

	} else {
		$('#buttonGetCode').attr('disabled', true);
		if (strNum.length < 4) {
			$("#" + idPhone).val("+380");	//  
			$("#" + idPhone).mask("+38999 999 9999", {
	            autoclear: false
	        });
			$("#" + idPhone).focus();	//  
			$("#" + idPhone).selectionStart = 4;	//   
		}
	}
	
	return true;
}

