function wishMusic() {
    var audio = $("#wish")[0];
    if (audio) {
        audio.volume = 0.2;

        $('.paused').click(function() {
            audio.muted = true;
            $(this).addClass('hidden');
            $('.played').removeClass('hidden');
            $('.equalizer span').addClass('hidden');
        });
        $('.played').click(function() {
            $(this).addClass('hidden');
            $('.paused').removeClass('hidden');
            $('.equalizer span').removeClass('hidden');
            audio.muted = false;
        });
    }

}

